    const [products, setProducts] = useState([]);
    useEffect(() => {
        const productData = async () => {
            const { data } = await fetchProducts();
            setProducts(data)
        };
        productData()

    },[])
    console.log(products)
    return(
        <div>
            {products.map((product)=><div><p>{product.name}</p></div>)}
        </div>
    )
}

export default HomeScreen;
